import { useState, useEffect } from "react";
import axios from "axios";
import { Container, Form, Button } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import "../styles/Login.css";

const Signup = () => {
  useEffect(() => {
    document.documentElement.scrollTop = 0; // Force scroll to top
    document.body.scrollTop = 0;
  }, []);

  const [formData, setFormData] = useState({
    name: "",
    age: "",
    bp: "",
    sugar: "",
    heartRate: "",
    patientID: "",
    password: ""
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      console.log("Submitting Data:", formData); // üîç Debugging log
      await axios.post("http://localhost:5000/api/auth/signup", formData);
      alert("Patient registered successfully!");
      navigate("/");
    } catch (error) {
      console.error("Error registering patient:", error);
    }
  };

  return (
    <div className="login-wrapper"> {/* Centers the signup box */}
      <Container className="container"> {/* Styled container */}
        <h2 className="heading">Register Patient</h2>
        <Form className="form" onSubmit={handleSubmit}>
          <Form.Group>
            <Form.Label>Name</Form.Label>
            <Form.Control 
              className="input"
              type="text" 
              name="name" 
              onChange={handleChange} 
              required 
              placeholder="Enter full name"
            />
          </Form.Group>
          <Form.Group>
            <Form.Label>Age</Form.Label>
            <Form.Control 
              className="input"
              type="number" 
              name="age" 
              onChange={handleChange} 
              required 
              placeholder="Enter age"
            />
          </Form.Group>
          <Form.Group>
            <Form.Label>BP</Form.Label>
            <Form.Control 
              className="input"
              type="text" 
              name="bp" 
              onChange={handleChange} 
              required 
              placeholder="Enter BP level"
            />
          </Form.Group>
          <Form.Group>
            <Form.Label>Sugar</Form.Label>
            <Form.Control 
              className="input"
              type="text" 
              name="sugar" 
              onChange={handleChange} 
              required 
              placeholder="Enter Sugar level"
            />
          </Form.Group>
          <Form.Group>
            <Form.Label>Heart Rate</Form.Label>
            <Form.Control 
              className="input"
              type="text" 
              name="heartRate" 
              onChange={handleChange} 
              required 
              placeholder="Enter Heart Rate"
            />
          </Form.Group>
          <Form.Group>
            <Form.Label>Patient ID</Form.Label>
            <Form.Control 
              className="input"
              type="text" 
              name="patientID" 
              onChange={handleChange} 
              required 
              placeholder="Enter unique Patient ID"
            />
          </Form.Group>
          <Form.Group>
            <Form.Label>Password</Form.Label>
            <Form.Control 
              className="input"
              type="password" 
              name="password" 
              onChange={handleChange} 
              required 
              placeholder="Create a password"
            />
          </Form.Group>
          <Button className="login-button" type="submit">Register</Button>
        </Form>
      </Container>
    </div>
  );
};

export default Signup;
